import "../../components/Dropdown/Dropdown.css";

export default function Dropdown(props:{ characters: any, comics: any }) {
      return (
        <select name="selectList" id="selectList">
          {props.comics.map((comic: any) => {
             <option key={props.comics.characters.id} value={props.comics.characters.id}>{props.comics.characters.name}</option>
          })}
            <option key={props.characters.id} value={props.characters.id}>{props.characters.name}</option>
       </select>
      );
    };
